        csv('../dataset/sachin.csv', (error, data) => {
            console.log('hello')
        })
    }
    render() {

      return (

          <div className='App'>
              <div className='App-header'>
                  <h2>d3ia dashboard</h2>
              </div>
              <div>
                  <BarChart data={[5,10,1,3]} size={[500,500]} />
              </div>
          </div>
      )
  }
}

export default App;
